import React from "react";
import './SignUp.css'
import SignUpReduxForm from "../ReduxForms/SignUpReduxForm/SignUpReduxForm";

const SignUp = (props) => {
    return (
        <div className="SignUp">
            <div className="SignUpWrapper">
                <h3>Регистрация</h3>
                <img src="" alt="userIcon"/>
                <SignUpReduxForm/>
            </div>
        </div>
    )
};

export default SignUp;
